package by\.epam\.javatraining\.shmarlouski\.maintask01\.model\;

import java\.util\.Random\;

/\*\*
 \* This class contains different static methods for working with vector\.
 \*
 \* \@author Smarlouski Ihar
 \* \@version 1\.0\.0
 \*/


public class VectorLogic \{

 private final static Random random \= new Random\(\)\;

 public static double\[\] fillArray\(double\[\] array\) \{

 for \(int i \= 0\; i \< array\.length\; i\+\+\) \{
 array\[i\] \= \(int\) \(random\.nextDouble\(\) \* 10\)\;
 \}
 return array\;
 \}

 public static double findMinElement\(double\[\] array\) \{
 double minElement \= array\[0\]\;
 for \(int i \= 1\; i \< array\.length\; i\+\+\) \{
 if \(array\[i\] \< minElement\) \{
 minElement \= array\[i\]\;
 \}
 \}
 return minElement\;
 \}

 public static double findMaxElement\(double\[\] array\) \{
 double maxElement \= array\[0\]\;
 for \(int i \= 1\; i \< array\.length\; i\+\+\) \{
 if \(array\[i\] \> maxElement\) \{
 maxElement \= array\[i\]\;
 \}
 \}
 return maxElement\;
 \}

 public static double findArithmeticAverage\(double\[\] array\) \{
 double arithmeticAverage \= 0\;
 double sumOfAllElements \= 0\;
 for \(int i \= 0\; i \< array\.length\; i\+\+\) \{
 sumOfAllElements \+\= array\[i\]\;
 \}
 double numberOfElements \= array\.length\;
 arithmeticAverage \= sumOfAllElements / numberOfElements\;
 return arithmeticAverage\;
 \}

 public static double findGeometricAverage\(double\[\] array\) \{
 double numbersMultiply \= 1\;
 for \(int i \= 0\; i \< array\.length\; i\+\+\) \{
 numbersMultiply \*\= array\[i\]\;
 \}
 double geometricAverage \= Math\.pow\(numbersMultiply\, 1\.0 / array\.length\)\;
 return geometricAverage\;
 \}

 public static boolean isSorted\(double\[\] array\) \{
 boolean arisingOfNumbers \= true\;
 for \(int i \= 1\; i \< array\.length\; i\+\+\) \{
 if \(array\[i\] \< array\[i \- 1\]\) \{
 arisingOfNumbers \= false\;
 break\;
 \}
 \}
 boolean descendingOfNumbers \= true\;
 for \(int i \= 1\; i \< array\.length\; i\+\+\) \{
 if \(array\[i\] \> array\[i \- 1\]\) \{
 descendingOfNumbers \= false\;
 break\;
 \}
 \}
 return arisingOfNumbers \|\| descendingOfNumbers\;
 \}

 public static int findLocalMinElementPosition\(double\[\] array\) \{
 int position \= \-1\;
 for \(int i \= 0\; i \< array\.length\; i\+\+\) \{
 if \(i \!\= 0 \&\& i \!\= array\.length \- 1\) \{
 if \(array\[i\] \< array\[i \- 1\] \&\& array\[i\] \< array\[i \+ 1\]\) \{
 position \= i\;
 break\;
 \}
 \}
 \}
 return position\;
 \}

 public static int findLocalMaxElementPosition\(double\[\] array\) \{
 int position \= \-1\;
 for \(int i \= 0\; i \< array\.length\; i\+\+\) \{
 if \(i \!\= 0 \&\& i \!\= array\.length \- 1\) \{
 if \(array\[i\] \> array\[i \- 1\] \&\& array\[i\] \> array\[i \+ 1\]\) \{
 position \= i\;
 break\;
 \}
 \}
 \}
 return position\;
 \}

 public static boolean elementLinearSearch\(double\[\] array\, double element\) \{
 boolean answer \= false\;
 for \(int i \= 0\; i \< array\.length\; i\+\+\) \{
 if \(array\[i\] \=\= element\) \{
 answer \= true\;
 break\;
 \}
 \}
 return answer\;
 \}

 public static boolean elementBinarySearch\(double\[\] array\, double element\) \{
 bubbleSort\(array\)\;
 boolean answer \= false\;

 int leftBorder \= 0\;
 int rightBorder \= array\.length \- 1\;

 while \(leftBorder \<\= rightBorder\) \{

 int middle \= \(leftBorder \+ rightBorder\) / 2\;
 if \(element \=\= array\[middle\]\) \{
 answer \= true\;
 break\;
 \}
 if \(element \> array\[middle\]\) \{
 leftBorder \= middle \+ 1\;
 \} else \{
 rightBorder \= middle \- 1\;
 \}
 \}
 return answer\;
 \}

 public static void reverseArray\(double\[\] array\) \{
 int leftBorder \= 0\;
 int rightBorder \= array\.length \- 1\;
 while \(leftBorder \< rightBorder\) \{
 double tempElement \= array\[leftBorder\]\;
 array\[leftBorder\] \= array\[rightBorder\]\;
 array\[rightBorder\] \= tempElement\;
 leftBorder\+\+\;
 rightBorder\-\-\;
 \}
 \}

 public static void bubbleSort\(double\[\] array\) \{
 for \(int i \= array\.length \- 1\; i \> 0\; i\-\-\) \{
 for \(int j \= 1\; j \< array\.length\; j\+\+\) \{
 if \(array\[j\] \< array\[j \- 1\]\) \{
 array\[j\] \= array\[j\] \+ array\[j \- 1\]\;
 array\[j \- 1\] \= array\[j\] \- array\[j \- 1\]\;
 array\[j\] \= array\[j\] \- array\[j \- 1\]\;
 \}
 \}
 \}
 \}

 public static void insertionSort\(double\[\] array\) \{

 for \(int left \= 0\; left \< array\.length\; left\+\+\) \{
 // Вытаскиваем значение элемента
 double value \= array\[left\]\;
 // Перемещаемся по элементам\, которые перед вытащенным элементом
 int i \= left \- 1\;
 for \(\; i \>\= 0\; i\-\-\) \{
 // Если вытащили значение меньшее \— передвигаем больший элемент дальше
 if \(value \< array\[i\]\) \{
 array\[i \+ 1\] \= array\[i\]\;
 \} else \{
 // Если вытащенный элемент больше \— останавливаемся
 break\;
 \}

 \}
 // В освободившееся место вставляем вытащенное значение
 array\[i \+ 1\] \= value\;
 \}
 \}

 public static void selectionSort\(double\[\] array\) \{
 for \(int left \= 0\; left \< array\.length\; left\+\+\) \{
 int minIndex \= left\;
 for \(int i \= left \+ 1\; i \< array\.length\; i\+\+\) \{
 if \(array\[i\] \< array\[minIndex\]\) \{
 minIndex \= i\;
 \}
 \}
 double temp \= array\[left\]\;
 array\[left\] \= array\[minIndex\]\;
 array\[minIndex\] \= temp\;
 \}
 \}

 public static void oneCicleForSort\(double\[\] array\) \{
 for \(int i \= 1\; i \< array\.length\; i\+\+\) \{
 if \(array\[i\] \< array\[i \- 1\]\) \{
 array\[i\] \= array\[i\] \+ array\[i \- 1\]\;
 array\[i \- 1\] \= array\[i\] \- array\[i \- 1\]\;
 array\[i\] \= array\[i\] \- array\[i \- 1\]\;
 oneCicleForSort\(array\)\;
 \}
 \}
 \}

 public static void quickSort\(double\[\] array\, int left\, int right\) \{
 int i \= left\;
 int j \= right\;
 double h \= array\[\(i \+ j\) / 2\]\;
 do \{
 while \(array\[i\] \< h\) \{
 i\+\+\;
 \}
 while \(array\[j\] \> h\) \{
 j\-\-\;
 \}
 if \(i \<\= j\) \{
 if \(i \< j\) \{
 double temp \= array\[i\]\;
 array\[i\] \= array\[j\]\;
 array\[j\] \= temp\;
 \}
 i\+\+\;
 j\-\-\;
 \}
 \} while \(i \<\= j\)\;

 if \(i \< right\) \{
 quickSort\(array\, i\, right\)\;
 \}
 if \(left \< j\) \{
 quickSort\(array\, left\, j\)\;
 \}

 \}

 public static void mergeSort\(double\[\] array\, int first\, int last\) \{
 if \(last \> first\) \{
 int mid \= first \+ \(last \- first\) / 2\;
 mergeSort\(array\, first\, mid\)\;
 mergeSort\(array\, mid \+ 1\, last\)\;

 double\[\] buf \= Arrays\.copyOf\(array\, array\.length\)\;

 for \(int k \= first\; k \<\= last\; k\+\+\)
 buf\[k\] \= array\[k\]\;

 int i \= first\, j \= mid \+ 1\;
 for \(int k \= first\; k \<\= last\; k\+\+\) \{

 if \(i \> mid\) \{
 array\[k\] \= buf\[j\]\;
 j\+\+\;
 \} else if \(j \> last\) \{
 array\[k\] \= buf\[i\]\;
 i\+\+\;
 \} else if \(buf\[j\] \> buf\[i\]\) \{
 array\[k\] \= buf\[j\]\;
 j\+\+\;
 \} else \{
 array\[k\] \= buf\[i\]\;
 i\+\+\;
 \}
 \}
 \}
 \}

 \}
